import React, { Component } from "react";
import Image from 'react';
import headshot from '.../public/images/headshot.jpg';



class About extends Component{
    render () {
        return(
            <section id='about'>
                <h1>All About McKayla </h1>
                <Image items={headshot}/>
                <h2>Work</h2>
                <h2>Play</h2>

            </section>
        );
    }
}

export default About;
